DROP TABLE IF EXISTS `dna_flow_his`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `dna_flow_his` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `dna_flow_id` int(11) NOT NULL,
  `barcode_long` varchar(25) NOT NULL COMMENT '长条码编号',
  `hospital` varchar(25) DEFAULT NULL COMMENT '医院名称',
  `sample_code` varchar(25) DEFAULT NULL COMMENT '样本编号',
  `sample_date` datetime DEFAULT NULL COMMENT '采样日期',
  `receive_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '接收日期',
  `real_name` varchar(20) DEFAULT NULL COMMENT '姓名',
  `id_card` varchar(20) DEFAULT NULL COMMENT '身份证',
  `age` smallint(2) DEFAULT NULL COMMENT '年龄',
  `pregnancy_week` varchar(10) DEFAULT NULL COMMENT '孕周',
  `pregnancy_condition` varchar(45) DEFAULT NULL COMMENT '妊娠情况',
  `pregnancy_bad_history` varchar(25) DEFAULT NULL COMMENT '不良孕产史',
  `comments` varchar(55) DEFAULT NULL COMMENT '备注',
  `inputter` varchar(10) DEFAULT NULL COMMENT '录入人员',
  `input_date` datetime DEFAULT NULL COMMENT '录入日期',
  `changer` varchar(10) DEFAULT NULL COMMENT '换管人员',
  `change_date` datetime DEFAULT NULL COMMENT '换管日期',
  `checker` varchar(10) DEFAULT NULL COMMENT '审批人员',
  `check_date` datetime DEFAULT NULL COMMENT '审批日期',
  `warehouser` varchar(10) DEFAULT NULL COMMENT '入库人',
  `warehouse_place` varchar(15) DEFAULT NULL COMMENT '入库位置',
  `warehouse_date` datetime DEFAULT NULL COMMENT '入库时间',
  `sample_outer` varchar(10) DEFAULT NULL COMMENT '短采血管出库人',
  `sample_out_residue` tinyint(2) DEFAULT NULL COMMENT '接收组试管剩余数量',
  `extract_handover` varchar(10) DEFAULT NULL COMMENT '提取组接收人',
  `extract_handover_date` datetime DEFAULT NULL COMMENT '提取组接收时间',
  `extract_qbite_deep` varchar(45) DEFAULT NULL COMMENT 'qbite浓度',
  `extract_epoch_deep` varchar(45) DEFAULT NULL COMMENT 'epoch浓度',
  `extract_purity_deep` varchar(45) DEFAULT NULL COMMENT '纯度',
  `extract_part_size` varchar(45) DEFAULT NULL COMMENT '片段大小',
  `extract_part_after_break` varchar(45) DEFAULT NULL COMMENT '打断后片段',
  `extracter` varchar(10) DEFAULT NULL COMMENT '提取人员',
  `extract_date` datetime DEFAULT NULL COMMENT '提取时间',
  `extract_checker` varchar(45) DEFAULT NULL COMMENT '提取审核人',
  `extract_check_date` datetime DEFAULT NULL COMMENT '提取审核时间',
  `extract_outer` varchar(10) DEFAULT NULL COMMENT '提取出库人',
  `extract_out_residue` tinyint(2) DEFAULT NULL COMMENT '提取组试管剩余数量',
  `storage_handover` varchar(10) DEFAULT NULL COMMENT '建库组接收人',
  `storage_handover_date` datetime DEFAULT NULL COMMENT '建库组接收时间',
  `storage_deep` varchar(45) DEFAULT NULL COMMENT '建库浓度',
  `storage_index` varchar(45) DEFAULT NULL COMMENT '建库index号',
  `storage_part_size` varchar(45) DEFAULT NULL COMMENT '建库片段大小',
  `storager` varchar(10) DEFAULT NULL COMMENT '建库人',
  `storage_date` datetime DEFAULT NULL COMMENT '建库时间',
  `storage_checker` varchar(10) DEFAULT NULL COMMENT '建库审查人',
  `storage_check_date` datetime DEFAULT NULL COMMENT '建库审查时间',
  `storage_outer` varchar(10) DEFAULT NULL COMMENT '建库组出库人',
  `storage_out_residue` varchar(25) DEFAULT NULL COMMENT '建库组试管剩余数量',
  `operate_handover` varchar(10) DEFAULT NULL COMMENT '上机组接收人',
  `operate_handover_date` datetime DEFAULT NULL COMMENT '上机组接收时间',
  `operate_chip_code` varchar(25) DEFAULT NULL COMMENT '上机芯片编码',
  `operate_reads_val` varchar(45) DEFAULT NULL COMMENT '上机reads数',
  `operate_q30_val` varchar(45) DEFAULT NULL COMMENT '上机q30值',
  `operater` varchar(10) DEFAULT NULL COMMENT '上机人',
  `operate_date` datetime DEFAULT NULL COMMENT '上机时间',
  `operate_checker` varchar(10) DEFAULT NULL COMMENT '上机审查人',
  `operate_check_date` datetime DEFAULT NULL COMMENT '上机审查时间',
  `operate_outer` varchar(10) DEFAULT NULL COMMENT '上机组出库人',
  `operate_out_residue` varchar(25) DEFAULT NULL COMMENT '上机组试管剩余数量',
  `report_handover` varchar(10) DEFAULT NULL COMMENT '分析报告组接收人',
  `report_handover_date` datetime DEFAULT NULL COMMENT '分析报告组接收时间',
  `report_result` varchar(250) DEFAULT NULL COMMENT '分析结果',
  `report_advice` varchar(250) DEFAULT NULL COMMENT '建议',
  `report_is_send` tinyint(2) DEFAULT NULL COMMENT '是否发送（1、不发送；2、发送）',
  `reporter` varchar(10) DEFAULT NULL COMMENT '分析人',
  `report_date` datetime DEFAULT NULL COMMENT '分析时间',
  `report_sender` varchar(10) DEFAULT NULL COMMENT '报告发送人',
  `report_send_date` datetime DEFAULT NULL COMMENT '报告发送时间',
  `status` tinyint(2) DEFAULT NULL COMMENT '状态（０、已删除；1、已录入采血单；2、已审批；3、已入库；４、交接后未提取；５、提取且已保存；６、提取审核-合格；７、提取审核-废弃；８、提取审核-重提取；９、交接后未建库；10、建库且已保存；11、建库审核-合格；12、建库审核-废弃；13、建库审核-重建库；14、交接后未上机；15、上机已保存；16、上机审核-合格；17、上机审核-废弃；18、上机审核-重上机；19、交接后未分析；20、分析已保存；21、报告已发送）',
  PRIMARY KEY (`id`),
  KEY `fk_dna_flow_fk_id1_idx` (`dna_flow_id`),
  CONSTRAINT `fk_dna_flow_fk_id1` FOREIGN KEY (`dna_flow_id`) REFERENCES `dna_flow` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 COMMENT='DNA检测历史表';
